export default function AdicionarHospedagem() {
  return (
    <div>
      <h1>Adicionar hospedagem</h1>
      <form>
  <label>
    Nome:
    <input type="text" name="name" />
  </label>
  <input type="submit" value="Enviar" />
</form>
    </div>
  );
}
